  <script>
  $(function() {
    function update(base) {
      $("#height").html(base/3);
      $("td").html(function () {
        var h = parseInt(this.getAttribute("v"))-base;
        if (h<0)    return "";
        if (h<3)   return "<b>"+h+"</b>";
        if (h<6)   return h;
        return "-";
      });
    }
  
    var s = $("#slider").slider({
        min: 0,
        max: 129,
        value: 0,
        step: 3,
        slide: function(ev,slider) {
          update(slider.value);
        }
    });
    update(0);
  });
  </script>
